import PRODUCT_DATA from "./product.data";
import PRODUCT_VIEW from "./product-view.data";

const INITIAL_STATE = {
  collections: PRODUCT_DATA,
  review: PRODUCT_VIEW,
};

const productReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default productReducer;
